import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	root: {
		background: "#FAF9F9",
		borderRadius: "15px",

		justifyContent: "center",
		width: "100%",
		color: "#D2D2D2",
	},
}));
